class ListNode:

    def __init__(self, x):
        self.val = x
        self.next = None

def detectCycle(head):
    if head is None and head.next is None:
        return None
    slow = head
    fast = head
    while fast is not None and fast.next is not None:
        slow = slow.next
        fast = fast.next.next
        if slow == fast:
            break
    else:
        return None
    slow = head
    while slow != fast:
        slow = slow.next
        fast = fast.next
    return slow

